import React from "react";

export default function Home() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center p-6 bg-white">
      <h1 className="text-5xl font-bold mb-4">Welcome to Alucentra Consulting</h1>
      <p className="text-lg max-w-xl text-center text-gray-700">
        Illuminating transformation through clarity, insight, and operational excellence.
      </p>
    </div>
  );
}
